import Navbar from "../Components/Navbar";
import Footer from "../Components/Footer";

import alphard from "../image/mobil/alphard.webp";

export default function DetailMobil() {
    return (
        <>
            <Navbar />
            <div className="container w-100 h-auto my-40 mx-auto rounded-2xl p-20 bg-[#F4F6F5]">
                <h1 className="font-black text-4xl text-left mb-10">
                    DETAIL PENYEWAAN
                </h1>
                <div className="w-100 flex justify-between lg:flex-row">
                    <img className="w-1/2" src={alphard} alt="" />
                    <h1>Alphard</h1>
                </div>
            </div>
            <Footer />
        </>
    );
}
